<!DOCTYPE html><html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en-us"><head><style type="text/css"> @import url('http://www.gnu.org/software/emacs/manual.css');</style></head><body style="padding:1rem;"><strong>proced-string-lessp</strong> is a compiled Lisp function in `<code>proced.el</code>'.</br>
</br>
(proced-string-lessp <u>S1</u> <u>S2</u>)</br>
</br>
Return t if string <u>S1</u> is less than <u>S2</u> in lexicographic order.</br>
Return `equal' if <u>S1</u> and <u>S2</u> have identical contents.</br>
Return nil otherwise.<br/><br/><br/><br/><small>A courtesy of <a href="http://endlessparentheses.com/">Endless Parentheses</a>.</small></body></html>
